import React from 'react';
import ReactDOM from 'react-dom';

class App extends React.Component {



	render() {
		return (
			<div>
				<div>
					<q>Test</q>
				</div>
				<div>
					<h5>test</h5>
				</div>
			</div>
		)
	}
}

ReactDOM.render(<App />, document.querySelector('#root'));
